import React, { useEffect, useState } from "react";
import { performAnalysis } from "..analysis/performAnalysis";

const AnalysisDisplay = () => {
  const [metrics, setMetrics] = useState({
    totalROI: 0,
    numberOfTrades: 0,
    sharpeRatio: 0,
    netPL: 0,
    cashBalance: 0,
    winningTrades: 0,
    losingTrades: 0,
    winRate: 0,
    averageWin: 0,
    averageLoss: 0,
    riskRewardRatio: 0,
    maximumDrawdown: 0,
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const results = await performAnalysis();
        setMetrics(results);
      } catch (error) {
        console.error("Error fetching analysis data:", error);
      }
    };

    fetchData();
  }, []);

  // Debugging logs
  console.log("Analysis Display Metrics:", metrics);

  return (
    <div className="analysis-container">
      <div className="analysis-card">
        <h3>Total ROI</h3>
        <p>{metrics.totalROI.toFixed(2)}%</p>
      </div>
      <div className="analysis-card">
        <h3>Number of Trades</h3>
        <p>{metrics.numberOfTrades}</p>
      </div>
      <div className="analysis-card">
        <h3>Sharpe Ratio</h3>
        <p>{metrics.sharpeRatio.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Net P/L</h3>
        <p>${metrics.netPL.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Cash Balance</h3>
        <p>${metrics.cashBalance.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Winning Trades</h3>
        <p>{metrics.winningTrades}</p>
      </div>
      <div className="analysis-card">
        <h3>Losing Trades</h3>
        <p>{metrics.losingTrades}</p>
      </div>
      <div className="analysis-card">
        <h3>Win Rate</h3>
        <p>{metrics.winRate.toFixed(2)}%</p>
      </div>
      <div className="analysis-card">
        <h3>Average Win</h3>
        <p>${metrics.averageWin.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Average Loss</h3>
        <p>${metrics.averageLoss.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Risk-Reward Ratio</h3>
        <p>{metrics.riskRewardRatio.toFixed(2)}</p>
      </div>
      <div className="analysis-card">
        <h3>Maximum Drawdown</h3>
        <p>{metrics.maximumDrawdown.toFixed(2)}%</p>
      </div>
    </div>
  );
};

export default AnalysisDisplay;
